import React from 'react';
import {
  Container,
  Grid,
  IconButton,
  List,
  ListItem,
  ListItemText,
  Typography
} from '@material-ui/core';
import {
  Language as WebIcon,
  Settings as SettingsIcon
} from '@material-ui/icons';

import { webThreatData } from '../data';

export default function WebControlContainer(props){
  console.log('props', props);
  return(
    <Container>
      <Grid container>
        <WebIcon />
        <Typography>Web Protection</Typography>
      </Grid>
      <Grid container>
        <Typography>Protection level: High</Typography>
        <IconButton>
          <SettingsIcon />
        </IconButton>
      </Grid>
      <Typography>Active Categories</Typography>
      <List>
        {webThreatData.map((member) => {
            console.log('member', member)
            if(member.familyMember === props.familyMember.first_name){
              member.threats.map((threat) => {
                  <ListItem>
                    <ListItemText>{threat.category}</ListItemText>
                  </ListItem>
              }
            );
          };
        })}
      </List>
    </Container>
  );
};
